Let’s review this “Hello, world!” program in detail. Here’s the first piece of the puzzle: fn main() {
# println!("Hello, world!");
} These lines define a function named main. The main function is special: it is always the first code that runs in every executable Rust program. Here the first line declares a function named main that has no parameters and returns nothing. If there were parameters, they would go inside the parentheses (). The function body is wrapped in {}. Rust requires curly brackets around all function bodies. It's good style to place the opening curly bracket on the same line as the function declaration, adding one space in between. If you want to stick to a standard style across Rust projects, you can use an automatic formatter tool called rustfmt to format your code in a particular style (more on rustfmt in Appendix D). The Rust team has included this tool with the standard Rust distribution, as rustc is, so it should already be installed on your computer! The body of the main function hold the following code: # fn main() { println!("Hello, world!");
# } This line does all the work in this little program: it prints text to the screen. There are four important details to notice here. First, Rust style is to indent with four spaces, not a tab. Second, println! calls a Rust macro. If it had called a function instead, it would be entered as println(without the !). We'll discuss Rust macros in more detail in Chapter 19. For now, you just need to know that using a ! means that you're calling a macro instead of a normal function and that macros don't always follow the same rules as functions. Third, you see the "Hello, world!" string. We pass this string as an argument to println!, and the string is printed to the screen. Fourth, we end the line with a semicolon(;), which indicates that this expression is over and the next one is ready to begin. Most lines of Rust code end with a semicolon.

