The code in Listing 9-4 will panic! no matter why File::open failed. However, we want to take different actions for different failure reasons. If File::open failed because the file doesn't exist, we want to create the file and return the handle to the new file. If File::open failed for any other reason - for example, because we didn't have permission to open the file - we still want the code to panic! in the same way it did in Listing 9-4. For this, we add an inner match expression, shown in Listing 9-5. use std::fs::File;
use std::io::ErrorKind; fn main() { let greeting_file_result = File::open("hello.txt"); let greeting_file = match greeting_file_result { Ok(file) => file, Err(error) => match error.kind() { ErrorKind::NotFound => { match File::create("hello.txt") { Ok(fc) => fc, Err(e) => panic!( "Problem creating the file: {:?}", e ), } } other_error => { panic!( "Problem opening the file: {:?}", other_error ); } }, };
} Listing 9-5: Handling different kinds of errors in different ways The type of the value that File::open returns inside the Err variants is io::Error, which is a struct provided by the standard library. This struct has a method kind that we can call to get an io::ErrorKind value. The enum io::ErrorKind is provided by the standard library and has variants representing the different kinds of errors that might result from an io operation. The variant we want to use is ErrorKind::NotFound, which indicates the file we're trying to open doesn't exist yet. So we match on greeting_file_result, but we also have an inner match on error.kind(). The condition we want to check in the inner match is whether the value returned by error.kind() is the NotFound variant of the ErrorKind enum. If it is, we try to create the file with File::create. However, because File::create could also fail, we need a second arm in the inner match expression. When the file can't be created, a different error message is printed. The second arm of the outer match stays the same, so the program panics on any error besides the missing file error. Alternatives to Using match with Result<T, E> That's a lot of match! The match expression is very useful but also very much a primitive. In Chapter 13, you'll learn about closures, which are used with many of the methods defined on Result<T, E>. These methods can be more concise than using match when handling Result<T, E> values in your code. For example, here's another way to write the same logic as shown in Listing 9-5, this time using closures and the unwrap_or_else method: use std::fs::File;
use std::io::ErrorKind; fn main() { let greeting_file_result = File::open("hello.txt").unwrap_or_else(|error| { if error.kind() == ErrorKind::NotFound { File::create("hello.txt").unwrap_or_else(|error| { panic!("Problem creating the file: {:?}", error); }) } else { panic!("Problem opening the file: {:?}", error); } });
} Although this code has the same behavior as Listing 9-5, it doesn't contain any match expressions and is cleaner to read. Come back to this example after you've read Chapter 13, and look up the unwrap_or_else method in the standard library documentation. Many more of these methods can clean up huge nested match expressions when you're dealing with errors. Shortcuts for Panic on Error: unwrap and expect Using match works well enough, but it can be a bit verbose and doesn't always communicate intent well. The Result<T, E> type has many helper methods defined on it to do various, more specific tasks. The unwrap method is a shorcut method implemented just like the match expression we wrote in Listing 9-4. If the Result value is the Ok variant, unwrap will return the value inside the Ok. If the Result is the Err variant, unwrap will call the panic! macro for us. Here is an example of unwrap in action: use std::fs::File; fn main() { let greeting_file = File::open("hello.txt").unwrap();
} If we run this code without a hello.txt file, we'll see an error message from the panic! call that the unwrap method makes: thread 'main' panicked at 'called `Result::unwrap()` on an `Err` value: Os { code: 2, kind: NotFound, message: "The system cannot find the file specified." }', src\main.rs:4:49 Similarly, the expect method lets us also choose the panic! error message. Using expect instead of unwrap and providing good error messages can convey your intent and make traking down the source of a panic easier. The syntax of expect looks like this: use std::fs::File; fn main() { let greeting_file = File::open("hello.txt") .expect("hello.txt should be included in this project");
} We use expect in the same way as unwrap: to return the file handle or call the panic! macro. The error message used by expect in its call to panic! will be the parameter that we pass to expect, rather than the default panic! message that unwrap uses. Here's what it looks like: thread 'main' panicked at 'hello.txt should be included in this project: Os { code: 2, kind: NotFound, message: "The system cannot find the file specified." }', src\main.rs:5:10 In production-quality code, most Rustaceans choose expect rather than unwrap and give more context about why the operation is expected to always succeed. That way, if your assumptions are ever proven wrong, you have more information to use in debugging.

