When a function's implementation calls something that might fail, instead of handling the error within the function itself, you can return the error to the calling code so that it can decide what to do. This is known as propagating the error and gives more control to the calling code, where there might be more information or logic that dictates how the error should be handled than what you have available in the context of your code. For example, Listing 9-6 shows a function that reads a username from a file. If the file doesn't exist or can't be read, this function will return those errors to the code that called the function. use std::fs::File;
use std::io::{self, Read}; fn read_username_from_file() -> Result<String, io::Error> { // 1 let username_file_result = File::open("hello.txt"); // 2 let mut username_file = match username_file_result { // 3 Ok(file) => file, // 4 Err(e) => return Err(e), // 5 }; let mut username = String::new(); // 6 match username_file.read_to_string(&mut username) { // 7 Ok(_) => Ok(username), // 8 Err(e) => Err(e), // 9 }
} Listing 9-6: A function that returns errors to the calling code using match This function can be written in a much shorter way, but we're going to start by doing a lot of it manually in order to explore error handling; at the end, we'll show the shorter way. Let's look at the return type of the function first: Result<String, io::Error> (1). This means the function is returning a value of the type Result<T, E>, where the generic parameter T has been filled in with the concrete type String and the generic type E has been filled in with the concrete type io::Error. If this function succeeds without any problems, the code that calls this function will receive an Ok value that holds a String - the username that this function read from the file (8). If this function encounters any problems, the calling code will receive an Err value that holds an instance of io::Error that contains more information about what the problems were. We chose io::Error as the return type of this function because that happens to be the type of the error value returned from both of the operations we're calling in this function's body that might fail: the File::open function (2) and the read_to_string method (7). The body of the function starts by calling the File::open function (2). Then we handle the Result value with a match similar to the match in Listing 9-4. If File::open succeeds, the file handle in the pattern variable file (4) becomes the value in the mutable variable username_file (3) and the function continues. In the Err case, instead of calling panic!, we use the return keyword to return ealy out of the function entirely and pass the error value from File::open, now in the pattern variable, e, back to the calling code as this function's error value (5). So, if we have a file handle in username_file, the function then creates a new String in variable username (6) and calls the read_to_string method on the file handle in username_file to read the contents of thef ile into username (7)