} impl Guess { pub fn new(value: i32) -> Guess { // 2 if value < 1 || value > 100 { // 3 panic!( // 4 "Guess value must be between 1 and 100, got {}.", value ); } Guess { value } // 5 } pub fn value(&self) -> i32 { // 6 self.value }
} Listing 9-13: A Guess type that will only continue with values between 1 and 100 First we define a struct named Guess that has a field named value that holds an i32 (1). This is where the number will be stored. Then we implement an associated function named new on Guess that creates instances of Guess values (2). The new function is defined to have one parameter named value of type i32 and to return a Guess. The code in the body of the new function tests value to make sure it's between 1 and 100 (3). If value doesn't pass this test, we make a panic! call (4), which will alert the programmer who is writing the calling code that they have a bug they need to fix, because creating a Guess with a value outside this range would violate the contract that Guess::new is relying on. The conditions in which Guess::new might panic should be discussed in its public-facing API documentation; we'll cover documentation conventions indicating the possibility of a panic! in the API documentation conventions indicating the possibility of a panic! in the API documentation that you create in Chapter 14. If value does pass the test, we create a new Guess with its value field set to the value parameter and return the Guess (5). Next, we implement a method named value that borrows self, doesn't have any other parameters, and returns an i32 ( 6). This kind of method is sometimes called a getter because its purpose is to get some data from its fields and return it. This public method is necessary because the value field of the Guess struct is private. It's important that the value field be private so code using the Guess struct is not allowed to set value directly: code outside the module must use the Guess::new function to create an instance of Guess, thereby ensuring there's no way for a Guess to have a value that hasn't been checked by the conditions in the Guess::new function. A function that has a parameter or returns only numbers between 1 and 100 could then declare in its signature 