} This construct eliminates a lot of nesting that would be necessary if you used loop, if, else, and break, and it's clearer. While a condition evaluates to true, the code runs; otherwise, it exits the loop. Looping Through a Collection with for You can choose to use the while construct to loop over the elements of a collection, such as an array. fn main() { let a = [10, 20, 30, 40, 50]; let mut index = 0; while index < 5 { println!("the value is: {}", a[index]); index += 1; }
